import React, { Component } from 'react';
import {Link} from "react-router-dom";

class Home extends Component{
    render(){
        return(
            <div>
                <p>HELLO FROM THE HOME PAGE</p>
                <Link to = {'./list'}>
                    <button>
                        My List
                    </button>
                </Link>
                

            </div>
        )
    }
}

export default Home;
